import React from 'react';
import { Link } from "react-router-dom";
import styled from 'styled-components';

const Menubar = () => {
  const MenuBar_container = styled.section`
    width: 100%;
    height: 76px;
    display: flex;
    justify-content: space-between;
  `

  const Logo_wrapper = styled.div`
    flex-grow:3;
    display: flex;
    justify-content: center;
    align-items: center;

    >span {
      width: 100px;
      border: 1px solid black;
    }
  `

  const Icon_wrapper = styled.div`
    flex-grow:4;
    display: flex;
    justify-content: center;
    align-items: center;
  `

  return (
    <>
      <MenuBar_container>
        <Logo_wrapper>
          <Link to="/"><span>로고</span></Link>
        </Logo_wrapper>
        <Icon_wrapper>
          <Link to="/list"><button>리스트보기</button></Link>
          <Link to="/add"><button>다이어리추가</button></Link>
        </Icon_wrapper>
      </MenuBar_container>
    </>
  );
};

export default Menubar;
